import React, { useState } from 'react'

export default function ChallengeOne() {

    const [state, setState] = useState(0);
    const data = [
        {
            title: 'Monday',
            string: 'Monday....'
        },
        {
            title: 'Tuesday',
            string: 'Tuesday.....'
        },
        {
            title: 'Wednesday',
            string: 'Wednesday.....'
        },
        {
            title: 'Thursday',
            string: 'Thursday.....'
        }
        ,
        {
            title: 'Friday',
            string: 'Friday.....'
        },
        {
            title: 'Saturday',
            string: 'Saturday.....'
        }
        ,
        {
            title: 'Sunday',
            string: 'Sunday......'
        }
    ]

    return (
        <div>
            <div>
                <button onClick={() => setState(0)}> Reset</button>
                <button onClick={() => setState(state - 1)}> Prev</button>
                <button onClick={() => setState(state + 1)}> Next</button>
                <p>{state}</p>
            </div>
        </div>
    )
}
